import React from 'react';
import '../App.css'
class Card extends React.Component{
    render(){
        return (
         <div className="item-card">
             <div className="row">
                <div className="col-2">
                    Netflix Account
                </div>
                <div className="col-2">
                   <Button class="btn btn-outline-success">$21</Button>
                </div>
             </div>
             <div>
              Progress bar goes here!
             </div>
        </div>
        );
    }
}

export default Card;
